import { Button } from "@mui/material";
import React, {useState} from "react";
import styled from 'styled-components'

export default function Todo() {
    const [count, setTodo] = useState(0)
    return (<TodoDiv>
        <h1>todo 페이지</h1>
        <p>할 일: {count >= 0 ? count : setTodo(0)}</p>
        <input type="text" id="todo"/>
        <Button variant="outlined" onClick={() => setTodo(count + document.getElementById('todo').value)}>추가</Button>
        <Button variant="outlined" onClick={() => setTodo(count - 1)}>삭제</Button>
        <Button variant="outlined" onClick={() => console.log(document.getElementById('todo').value)}>확인</Button>
    </TodoDiv>)
}

const TodoDiv = styled.div` text-align: center; `
